F4F Wildcat

War Documentary hosted by John Willyard, published by Aircraft Films in 2003 - English narration


Information
------------------------------

This film focuses on the development and combat history of the Grumman F4F Wildcat, and was created from holdings at the National Archives, the National Museum of Naval Aviation, the Naval Historical Center, and the Marine Corps Historical Center. The F4F Wildcat was the front-line carrier fighter in the first days of the pacific war - flying off legendary ships like the Lexington, Saratoga, Hornet, Yorktown and Enterprise - the Wildcat held the line as America built for victory.
Aircraft Films returned to the film preservation masters and commissioned new digital transfers, and the result brings the viewer as close as possible to the original images captured by combat cameramen. 

Produced &amp; Directed by Jonathan Strickland

